const router = require('express').Router();
const orm = require('sequelize')

router.get("/", (req, res) => {
    res.json([]);
});

router.get("/:id", (req, res) => {
    const { id } = req.params;
    res.json({
        id,
        nombre: "usuario",
    });

}); 

module.exports = router;
